import React from 'react';
import { useAuth0 } from '@auth0/auth0-react';

const addstock = () => {
  const { logout } = useAuth0();
  return (
    <button
      type="button"
      className="btn btn-danger btn-block"
      onClick={() => logout({
        returnTo: window.location.origin,
      })}
    >
      Log Out
    </button>
  );
};

export default addstock;
